INSERT INTO `information_items` VALUES (5,'0000000',129,'Otto van koppen','2023-04-16 16:32:25','Stats','','','','',730,53,4560,639,'2023-04-16 16:32:24','2023-04-16 16:32:24'),(6,'0000001',139,'Otto van koppen','2023-04-16 17:50:10','Inactive group','','','','',30,NULL,89,NULL,'2023-04-16 17:50:10','2023-04-16 17:50:10'),(7,'0000002',166,'Otto van koppen','2023-04-16 19:22:56','Joined','','','','',NULL,NULL,NULL,NULL,'2023-04-16 19:22:55','2023-04-16 19:22:55'),(8,'0000003',166,'Otto van koppen','2023-04-16 19:23:45','Hi, anyone has a good work from home opportunity for me?\nYour post is pending\nYour post is awaiting admin approval. If the admin team approves it, it\'ll become visible in the group.','','','','',NULL,NULL,NULL,NULL,'2023-04-16 19:23:44','2023-04-16 19:23:44'),(9,'0000004',167,'Otto van koppen','2023-04-16 19:28:20','2 new posts today\n5,250 in the last month\n31,150 total members\n+ 635 in the last week','','','','',NULL,NULL,NULL,NULL,'2023-04-16 19:27:17','2023-04-16 19:28:19'),(10,'0000005',168,'Otto van koppen','2023-04-16 19:29:26','No new posts today\nNo posts in the last month\n4,663 total members\n+ 8 in the last week\nCreated 2 years ago','','','','',NULL,NULL,NULL,NULL,'2023-04-16 19:29:26','2023-04-16 19:29:26'),(11,'0000006',173,'Otto van koppen','2023-04-16 19:42:52','Requested to join. Gave email. Approved? \n\nWork From Anywhere üó∫Ô∏è Community For Remote Workers & Digital Nomads\nPrivate group\n ¬∑\n12.0K members\nYour membership is pending approval\nAnswer these questions from the group admins to help them review your request to join. Only the admins and moderators will see your answers.\nAre you currently a digital nomad or working remotely?\nYou can choose multiple options\n\nYes\n\nNo\nWhat\'s the #1 topic you\'d like to learn more about in this group?\nYou can choose multiple options\n\nStarting an online business\n\nFinding remote jobs\n\nGrowing an online community\n\nSomething else\nWhat\'s a good email to send you helpful tips for digital nomads?\nWrite an answer...\nGroup rules\nGroup members agree to follow these rules:\n\nI agree to the group rules\n','','','','',NULL,NULL,NULL,NULL,'2023-04-16 19:42:52','2023-04-16 19:42:52'),(12,'0000007',180,'Otto van koppen','2023-04-16 19:58:22','Joined. ','','','','',NULL,NULL,NULL,NULL,'2023-04-16 19:58:21','2023-04-16 19:58:21'),(13,'0000008',181,'Otto van koppen','2023-04-16 20:05:32','Advertisements are not allowed in this group. Any post with ads will be deleted and user will be banned. Ok?\nQuestions not related to Bali will be deleted. User will be kicked out. Ok?','','','','',NULL,NULL,NULL,NULL,'2023-04-16 20:05:32','2023-04-16 20:05:32'),(14,'0000009',195,'Otto van koppen','2023-04-16 20:51:25','Req to join. \nPlease describe your occupation and benefits are you expecting this group may offer you.\n','','','','',NULL,NULL,NULL,NULL,'2023-04-16 20:51:25','2023-04-16 20:51:25'),(15,'000000a',200,'Otto van koppen','2023-04-16 21:00:47','Your request to participate is pending approval.\nAdmins help keep this public group safe by reviewing everyone before they can participate with others. Your review is still pending.\n\n\nGet started by submitting a request to participate\nEveryone in this public group is reviewed by admins before they can post or comment for the first time. Read and agree to the group rules to submit your request.\nYou can ask about housing but please do not advertise apartments or reply with adverts. Also please do not discuss apartment costs publicly\nYou can choose multiple options\n\nI do not agree\n\nI do agree\nNo spammy ads....If it is a workshop it\'s cool. If it is a general ad for a hotel or shop..No thanks\nYou can choose multiple options\n\nI agree\n\nI know I\'ll get kicked out and blocked if. I break this rule','','','','',NULL,NULL,NULL,NULL,'2023-04-16 21:00:47','2023-04-16 21:00:47'),(16,'000000b',210,'Otto van koppen','2023-04-17 03:55:40','No new posts today\n2 in the last month\n1,152,373 total members\n+ 20 in the last week','','','','',NULL,NULL,NULL,NULL,'2023-04-17 03:55:40','2023-04-17 03:55:40'),(17,'000000c',211,'Otto van koppen','2023-04-17 04:11:52','No new posts today\n5,839 in the last month\n12,949 total members\n+ 1,727 in the last week','','','','',5893,NULL,13000,NULL,'2023-04-17 04:11:51','2023-04-17 04:11:51'),(18,'000000d',211,'Otto van koppen','2023-04-17 04:16:29','Joined. Placed a test post. Declined immediately without feedback. \n\nChico Drono100% Legit Jobs Hiring (On-site and work from home)\nWho knows where I can find a good legitimate work from home job?\n','','','','',NULL,NULL,NULL,NULL,'2023-04-17 04:16:28','2023-04-17 04:16:28'),(19,'000000e',212,'Otto van koppen','2023-04-17 04:19:33','60 new posts today\n2,926 in the last month\n6,802 total members\n+ 766 in the last week','','','','',2926,NULL,6802,NULL,'2023-04-17 04:19:32','2023-04-17 04:19:32'),(20,'000000f',212,'Otto van koppen','2023-04-17 04:20:49','Your request to participate is pending approval.\nAdmins help keep this public group safe by reviewing everyone before they can participate with others. Your review is still pending.','','','','',NULL,NULL,NULL,NULL,'2023-04-17 04:20:48','2023-04-17 04:20:48'),(21,'000000g',213,'Otto van koppen','2023-04-17 04:34:53','No new posts today\n93 in the last month\n14,312 total members\n+ 117 in the last week','','','','',NULL,NULL,NULL,NULL,'2023-04-17 04:34:53','2023-04-17 04:34:53'),(22,'000000h',214,'Otto van koppen','2023-04-17 04:39:02','25 new posts today\n866 in the last month\n2,213 total members\n+ 6 in the last week','','','','',866,NULL,2213,NULL,'2023-04-17 04:39:02','2023-04-17 04:39:02'),(23,'000000i',215,'Otto van koppen','2023-04-17 04:43:11','11 new posts today\n259 in the last month\n24,529 total members\n+ 369 in the last week','','','','',259,NULL,24529,NULL,'2023-04-17 04:43:10','2023-04-17 04:43:10'),(24,'000000j',216,'Otto van koppen','2023-04-17 04:48:41','No new posts today\nNo posts in the last month\n5